import React, { Component } from 'react'

export default class index extends Component {
  render() {
    return (
      <div>
        <h1>Hola next!</h1>
        <style jsx global>{`
          body {
            background-color: gray;
          }
        `}</style>
        <style jsx>{`
          h1 {
            color: green;
          }

          body {
            background-color: yellow;
          }
        `}</style>

      </div>
    )
  }
}
